import React, { Component } from 'react';

class CollapsiblePanel extends Component {
  render() {
    var {header, count, linkList} = this.props;
    var li_list = [];
    for(var i=0; i<linkList.length; i++){
        var li = (<li>{linkList[i]}</li>);
        li_list.push(li);
    }
    return (
        <div class="panel-group">
            <div class="panel panel-default">
            <div class="panel-heading">
                <h4 class="panel-title">
                <a data-toggle="collapse" href={"#" + header + "collapse1"} className='display-block'>{header}
                    <button className='btn btn-warning margin-left-10'>{count}</button>
                </a>
                </h4>
            </div>
            <div id={header + "collapse1"} class="panel-collapse collapse">
                <ul>
                    {li_list}
                </ul>
            </div>
            </div>
        </div>
    );
  }
}

export default CollapsiblePanel;
